function _onInlineMsgClick() {
	var msg = _inlineMessages[this.msgIndex];
	if (msg.cbk && !msg.callback) {
		msg.callback = function(response) {
			response && alert(response[msg.$type == "prompt" ? "prompt" : "$clientId"]);
		};
	}
	syra_alert.dialog(syra_site.clone(msg));
}

function _onPopupMsgClick() {
	syra_alert.dialog(_popupMesages[this.msgIndex]);
}

exports.load = function(page, finish) {
	var curIn = 0;
	var cols = [page.leftCol, page.leftCol, page.addCol(page.leftCol.parentNode)];
	for (var mm = 0; mm < 3; mm++) {
		var col = cols[mm];
		col.style.width = "";
		if (mm == 0) {
			col.appendChild(document.createElement("BR"));
			for (var ii = 0, jj = _popupMesages.length; ii < jj; ii++) {
				syra_button.add({
					parent: page,
					slot: col,
					text: _popupMesages[ii].$linkTitle,
					css: "s-uitest-mn",
					btnclick: _onPopupMsgClick,
					msgIndex: ii
				});
			}
		} else {
			for (var ii = 0; ii <= 2; ii++) {
				var slot = col.appendChild(document.createElement("div"));
				slot.className = "s-uitest-msgbox-box";
				syra_button.add({
					parent: page,
					slot: slot,
					text: _inlineMessages[curIn].$linkTitle,
					css: "s-uitest-mn",
					btnclick: _onInlineMsgClick,
					msgIndex: curIn++
				});
			}
		}
	}
	finish(page);
};